description:
Movie Info: One By Two is a 2014 Hindi romantic comedy directed by Devika Bhagat. It released on 31 January 2014 at multiplexes with around 500 screens in India. The film features real life couple Abhay Deol and Preeti Desai. This is the story of Amit and Samara who meet each other while living in Mumbai The music of the film has been composed by Shankar-Ehsaan-Loy.


